    public static void main(String[] args)
    {
        String output = "";
        int count = 0;
        int last = 0;
        
        for (int i = 0; i < 10000; i++)
        {
            if (pattern[i] != last)
            {
                output += count + ",";
                count = 0;
                last = pattern[i];
            }
            count++;
        }
        output += count;
        System.out.println(output);

        for (int i = 0; i < 100; i++)
        {
            for (int j = 0; j < 100; j++)
            {
                if (pattern[j + i * 100] == 1)
                    System.out.print("■");
                else
                    System.out.print("□");

            }
            System.out.println();
        }

        System.out.println("Pattern length before compression " + pattern.length + " bits");

    }
